import { Component, ViewChild } from '@angular/core';
import { MatTableDataSource } from "@angular/material/table";
import { TrainingService } from "../training.service";
import { MatSort } from "@angular/material/sort";
import { MatPaginator } from "@angular/material/paginator";
import { Subscription } from "rxjs";
let PastTrainingComponent = class PastTrainingComponent {
    constructor(trainingService) {
        this.trainingService = trainingService;
        this.displayedColumns = [
            'date',
            'name',
            'calories',
            'duration',
            'state'
        ];
        this.dataSource = new MatTableDataSource();
        this.finishedExercisesSubscribtion = new Subscription();
    }
    ngOnInit() {
        this.finishedExercisesSubscribtion =
            this.trainingService
                .finishedExercisesChanged
                .subscribe((exercises) => {
                this.dataSource.data = exercises;
            }, (error) => {
                console.log('error :', error);
            });
        this.trainingService
            .getCompletedOrCanceledExercises();
    }
    ngAfterViewInit() {
        this.dataSource.sort = this.sort;
        this.dataSource.paginator = this.paginator;
    }
    // doFilter(filterValue: string) {
    //     this.dataSource.filter = filterValue
    // }
    doFilter(event) {
        this.dataSource.filter = event.target
            .value
            .trim()
            .toLowerCase();
    }
    ngOnDestroy() {
        this.finishedExercisesSubscribtion.unsubscribe();
    }
};
